//map 함수 사용할 때 : 박스 별로 키 값을 부여->고유한 값으로 식별 가능
import React from 'react';
import data from "./data/data.json";
import "./Boxb.css"
import LikeButton from "./LikeButton";

import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'

import {
    StyledBox,
    TextContainer,
    ProdName,
    ProdAddress,
    ProdPrice,
} from "./styled"


const Boxb = () => {
    return <>{data.products.map((product)=>(
        <>

            <StyledBox key={product.id}>
                <Router>
                <Routes>
                    <img src={product.img} alt="no imag"></img>
                    <Route 
                    key={product.id}
                    path="/"
                    element={
                        <>
                        <ProdName><b>{product.title}</b></ProdName>
                        <ProdAddress className="address"> {product.address}</ProdAddress>
                        <TextContainer>
                            <ProdPrice className="price"> {product.price}</ProdPrice>
                            <LikeButton />
                        </TextContainer>
                        </>
                    }></Route>
                </Routes>
                </Router>


            </StyledBox>
        </>
        ))}
        </>

};

export default Boxb
